import React from "react";
import ProductItem from "../ProductItem";
import "./index.scss";

function ProductsList({ products }) {
  return (
    <>
      {products.map((product) => (
        <ProductItem key={product.id} product={product} />
      ))}
    </>
  );
}

export default ProductsList;
